import './App.css';
import { useState } from 'react';

function App() {

  const [name, setName] = useState('');

  return(
    <div>
         <form>
                <h2>LOGIN</h2>

                <div className="top">
                  <label>Name:</label> <br></br>
                  <input 
                  type="text" 
                  required 
                  placeholder="write name"
                  onChange={(e) => setName(e.target.value)}
                  />
                </div>

                <div className="bottom">
                  <label>Password:</label> <br></br>
                  <input type="text" required placeholder="write password"/>
                </div>
                <button>login</button>

                <p>{name}</p>

            </form>
    </div>
  )

}




export default App;
